/** [ DEFINE PAGES ] **/

window.swogo.ui.setPage("pdp", function () {
    return ((window.location.href.indexOf("/catalogo/detalhesproduto") >= 0) && (document.querySelector('#prod-main')));
});
window.swogo.ui.setPage("basket", function () {
    return (window.location.href.indexOf("/basket/") >= 0);
});
window.swogo.ui.setPage("payment", function () {
    return (window.location.href.indexOf("/payment/") >= 0);
});

var pdpPage = window.swogo.ui.getPage("pdp");
pdpPage.extractSKUs(function getSkus (){
    var ids = [];
    var sku = window.location.href.match(/idprod=(\d+)/i)[1]

    ids.push(sku);
    return ids;
});
pdpPage.addBundle("pdp", pdpBundle);

var basketPage = window.swogo.ui.getPage("basket");
basketPage.extractSKUs(function getSkus (){
    var ids = [];
    return ids;
});
basketPage.setProductsData(function getProducts(){
    var items = [];
    var products = document.querySelectorAll(".cart-product-table");
    var productCount = products.length;
    for (var i = 0; i < productCount; i++) {
        var productId = products[i].querySelector(".sku");
        if (productId){
            var match = productId.textContent.match(/:\d+/gi);
            if (match && match.length) productId = match[0].replace(":","");
            var quantity = (products[i].querySelector(".item-qty.js-cartitem-qty"))? parseInt(products[i].querySelector(".item-qty.js-cartitem-qty").value.replace("number:","")): 1;
            var title = products[i].querySelector(".cproduct-heading").textContent || null;
            var price = products[i].querySelector(".cproduct-price-detail.ng-binding").textContent.replace("","") || null;
            for (var j=0; j < quantity; j++){
                items.push({
                    "id" : productId,
                    "price" : price ,
                    "title" : title
                })
            }
        }
    }
    return items;
});

